import styled from 'styled-components';
import styles from './App.module.scss';

const HeaderTitle = styled.h2`
  font-size: 1.5rem;
  font-weight: bold;
  padding: 8px 0;
`;

const Button = styled.button`
  background: #827ffe;
  font-size: 18px;
  color: #fff;
  text-transform: uppercase;
  display: flex;
  justify-content: center;
  align-items: center;
  padding: 0 20px;
  width: 100%;
  height: 62px;
  background-color: #827ffe;
  border-radius: 3px;
  border: 0;
  transition: all 0.4s;
  box-sizing: border-box;
  cursor: pointer;
  &:hover {
    background: #403866;
  }
`;

export { HeaderTitle };
